import { useState } from "react";
import "./SearchItems.css";
export default function SearchItems({ items, setSearchItems }) {
  const [titleSearch, setTitle] = useState("");
  function handleTitle(event) {
    setTitle(event.target.value);
  }

  function handleSumbit(event) {
    event.preventDefault();
    setSearchItems([items.filter((value) => value.icludes(titleSearch))]);
  }
  return (
    <>
      <div className="search-container">
        {/* <hr className="header-hr"></hr> */}
        <form className="search-form" onSubmit={handleSumbit}>
          <label className="search-label" htmlFor="title">
            Title
          </label>
          <input
            type="text"
            id="title"
            name="title"
            value={titleSearch}
            onChange={handleTitle}
          />
          <button id="login-button" type="submit">
            Login
          </button>
        </form>
        {/* <hr></hr> */}
      </div>
    </>
  );
}
